import Footer from "./Footer";
const Home = () => {
  return (
    <div>
      <Header />
      <Aboutus />
      <div className="flex flex-wrap justify-start items-center">
        <Card
          image={image1}
          date="August 1, 2024"
          duration="3 Months"
          max="30 Students Max"
